import React, { useState } from "react";
import Style from "./registrationForm.module.scss";
import {
  ImageSelector,
  TextArea,
  Buttons,
  Title,
  FormFields,
} from "components/formFields";
import axios from "axios";

export default function RegistrationForm() {
  const [formValues, setFormValues] = useState({
    placa: "",
    nome: "",
    marca: "",
    modelo: "",
    ano: "",
    cambio: "",
    potencia: "",
    torque: "",
    km: "",
    cor: "",
    cabine: "",
    relacaoDiferencial: "",
    tipo_suspensao: "",
    entreEixos: "",
    capMaxCombustivel: "",
    valor: "",
    infoOpicionais: "",
    infoAdicionais: "",
    imagem: "",
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post("http://localhost:4000/veiculo", formValues);
      console.log(res.data);
    } catch (error) {
      console.error(error);
    }
  };
  return (
    <>
      <div className={Style.container}>
        <div className={Style.form__container}>
          <label className={Style.form__title__field}>
            <Title title={"Cadastro de veículos"} Style={Style} />
            <form className={Style.form__field} onSubmit={handleSubmit}>
              <div className={Style.form}>
                <FormFields
                  type={"text"}
                  name={"NomeVeiculo"}
                  value={formValues.nome}
                  onChange={(e) =>
                    setFormValues({ ...formValues, nome: e.target.value })
                  }
                  placeholder={"Nome do Veiculo"}
                />
                <FormFields
                  name={"Fabricante"}
                  placeholder={"Fabricante"}
                  type={"text"}
                  value={formValues.marca}
                  onChange={(e) =>
                    setFormValues({ ...formValues, marca: e.target.value })
                  }
                />
                <FormFields
                  name={"Modelo"}
                  placeholder={"Modelo"}
                  type={"text"}
                  value={formValues.modelo}
                  onChange={(e) =>
                    setFormValues({ ...formValues, modelo: e.target.value })
                  }
                />
                <FormFields
                  name={"Ano"}
                  placeholder={"Ano"}
                  type={"number"}
                  value={formValues.ano}
                  onChange={(e) =>
                    setFormValues({ ...formValues, ano: e.target.value })
                  }
                />
              </div>
              <div className={Style.form}>
                <div className={Style.form__media}>
                  <FormFields
                    name={"Câmbio"}
                    placeholder={"Câmbio"}
                    type={"text"}
                    value={formValues.cambio}
                    onChange={(e) =>
                      setFormValues({ ...formValues, cambio: e.target.value })
                    }
                  />
                  <FormFields
                    name={"Potência"}
                    placeholder={"Potência (CV)"}
                    type={"text"}
                    value={formValues.potencia}
                    onChange={(e) =>
                      setFormValues({ ...formValues, nome: e.target.value })
                    }
                  />
                </div>
                <div className={Style.form__media}>
                  <FormFields
                    name={"Torque"}
                    placeholder={"Torque (N.m)"}
                    type={"text"}
                    value={formValues.torque}
                    onChange={(e) =>
                      setFormValues({ ...formValues, nome: e.target.value })
                    }
                  />
                  <FormFields
                    name={"KM"}
                    type={"number"}
                    placeholder={"KM"}
                    value={formValues.km}
                    onChange={(e) =>
                      setFormValues({ ...formValues, nome: e.target.value })
                    }
                  />
                </div>
              </div>
              <div className={Style.form}>
                <FormFields
                  name={"Cor"}
                  placeholder={"Cor"}
                  type={"text"}
                  value={formValues.cor}
                  onChange={(e) =>
                    setFormValues({ ...formValues, nome: e.target.value })
                  }
                />
                <FormFields
                  name={"Cabine"}
                  placeholder={"Cabine"}
                  type={"text"}
                  value={formValues.cabine}
                  onChange={(e) =>
                    setFormValues({ ...formValues, nome: e.target.value })
                  }
                />
                <FormFields
                  type={"text"}
                  name={"RelacaoDiferencial"}
                  placeholder={"Relação diferencial"}
                  value={formValues.relacaoDiferencial}
                  onChange={(e) =>
                    setFormValues({ ...formValues, nome: e.target.value })
                  }
                />
                <FormFields
                  name={"Suspensão"}
                  type={"text"}
                  placeholder={"Suspensão"}
                  value={formValues.tipo_suspensao}
                  onChange={(e) =>
                    setFormValues({ ...formValues, nome: e.target.value })
                  }
                />
              </div>
              <div className={Style.form}>
                <div className={Style.form__media}>
                  <FormFields
                    name={"EntreEixos"}
                    placeholder={"Entre-eixos"}
                    type={"number"}
                    value={formValues.entreEixos}
                    onChange={(e) =>
                      setFormValues({ ...formValues, nome: e.target.value })
                    }
                  />
                  <FormFields
                    name={"Placa"}
                    placeholder={"Placa do veículo"}
                    type={"text"}
                    value={formValues.placa}
                    onChange={(e) =>
                      setFormValues({ ...formValues, nome: e.target.value })
                    }
                  />
                  <FormFields
                    name={"Cap. max. combustível"}
                    placeholder={"Cap. combustível (L)"}
                    type={"number"}
                    value={formValues.capMaxCombustivel}
                    onChange={(e) =>
                      setFormValues({ ...formValues, nome: e.target.value })
                    }
                  />
                </div>
                <FormFields
                  name={"Valor"}
                  placeholder={"Valor (R$)"}
                  type={"text"}
                  value={formValues.valor}
                  onChange={(e) =>
                    setFormValues({ ...formValues, nome: e.target.value })
                  }
                />
              </div>
              <div className={Style.form__media__textarea}>
                <TextArea
                  name={"InfoAd"}
                  placeholder={"Informações opcionais"}
                  label={"Informações opcionais"}
                  Style={Style}
                  value={formValues.infoOpicionais}
                  onChange={(e) =>
                    setFormValues({ ...formValues, nome: e.target.value })
                  }
                />
                <TextArea
                  name={"InfoOp"}
                  placeholder={"Informações adicionais"}
                  label={"Informações adicionais"}
                  Style={Style}
                  value={formValues.infoAdicionais}
                  onChange={(e) =>
                    setFormValues({ ...formValues, nome: e.target.value })
                  }
                />
              </div>

              <div className={Style.buttons__field}>
                <ImageSelector label={"Selecionar múltiplas imagens"} />
                <Buttons
                  type={"reset"}
                  variant={"outline-danger"}
                  name={"Limpar"}
                />{" "}
                <Buttons
                  type={"submit"}
                  variant={"outline-success"}
                  name={"Cadastrar"}
                />
              </div>
            </form>
          </label>
        </div>
      </div>
    </>
  );
}
